import React from "react";
import logo from "./logo.svg";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Container,
  Row,
  Col,
  Button,
  Alert,
  Breadcrumb,
  Card,
  Form,
  Navbar,
} from "react-bootstrap";
import spotifyIcon from "./images/spotify-icon.png";

function App() {
  return (
    <div>
      <div className="App">
        <Navbar className="App-navbar">Kojo Obeng-Arhin</Navbar>
      </div>
      <div>
        <Card className="App-card">
          <Card.Img
            src={require("./images/spotify-youtube.jpg")}
            alt="Spotify-Youtube"
          />
          <Card.Body className="App-card-button-text">
            <Button variant="custom">Login With Spotify</Button>
          </Card.Body>
        </Card>
      </div>
    </div>
  );
}

export default App;
